import React, { useState } from 'react';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { authApi } from '../../api';

const Registration = () => {
  const [name, setName] = useState('');
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [passwordConfirm, setPasswordConfirm] = useState('');

  const isEmailValid = (email) => {
    // Regular expression for a basic email validation
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(email);
  };

  const isPasswordValid = (password) => {
    // Regular expression for password validation
    const passwordRegex = /^(?=.*?[A-Z])(?=.*?[a-z])(?=.*?[0-9])(?=.*[#$^+=!*()@%&]).{6,}$/;
    return passwordRegex.test(password);
  };

  const handleRegister = async () => {
    try {
      // Validation checks
      if (!name || !username || !email || !password || !passwordConfirm) {
        toast.warning('All fields are required.');
        return;
      }

      if (!isEmailValid(email)) {
        toast.warning('Enter a valid email address.');
        return;
      }

      if (!isPasswordValid(password)) {
        toast.warning('Password must meet the specified criteria.');
        toast.info('Minimum length 6 and must contain  1 Uppercase,1 lowercase, 1 special character and 1 digit');
        return;
      }

      if (password !== passwordConfirm) {
        toast.warning('Password and Confirm Password must match.');
        return;
      }

      const registrationData = {
        name,
        username,
        email,
        password,
        passwordConfirm
      };

      const result = await authApi.register(registrationData);
      toast.success('Registration successful.');
      console.log('Registration successful:', result);
      // Handle successful registration (e.g., show success message, redirect)
    } catch (error) {
      console.error('Registration failed:', error);
      // Handle registration error (e.g., display error message)
      toast.error('Registration failed. Please try again.');
    }
  };

  return (
    <div className="offset-lg-3 col-lg-6">
      <div className="card">
        <div className="card-header">
          <h1>User Registration</h1>
        </div>
        <div className="card-body">
          <form>
            <div className="form-group">
              <label>Name <span className="errmsg">*</span></label>
              <input type="text" className="form-control" value={name} onChange={(e) => setName(e.target.value)} />
            </div>
            <div className="form-group">
              <label>Username <span className="errmsg">*</span></label>
              <input type="text" className="form-control" value={username} onChange={(e) => setUsername(e.target.value)} />
            </div>
            <div className="form-group">
              <label>Email <span className="errmsg">*</span></label>
              <input type="text" className="form-control" value={email} onChange={(e) => setEmail(e.target.value)} />
            </div>
            <div className="form-group">
              <label>Password <span className="errmsg">*</span></label>
              <input type="password" className="form-control" value={password} onChange={(e) => setPassword(e.target.value)} />
            </div>
            <div className="form-group">
              <label>Confirm Password <span className="errmsg">*</span></label>
              <input type="password" className="form-control" value={passwordConfirm} onChange={(e) => setPasswordConfirm(e.target.value)} />
            </div>
            <button type="button" className="btn btn-primary" onClick={handleRegister}>Register</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Registration;
